import React from "react";
import { Link } from "react-router-dom";

function Nav(){
    return(
        // <nav class="navbar navbar-expand-lg bg-body-tertiary">
        // <div class="container-fluid">
        //     <p class="py-2">
        //     <Link to="/home" >
        //     <img src="./logo.png" style={{height:'30px'}}></img>
        //     </Link>
        //     </p>
        //     <p class="py-2 d-none d-md-inline-block">
        //         <Link to="/academics" style={{textDecoration:'none'}}>Academics</Link>
        //     </p>
        //     <p class="py-2 d-none d-md-inline-block">
        //     <Link to="/clubs" style={{textDecoration:'none', padding: '5px'}} >Clubs and Chapters</Link>
        //     </p>
        //     <p class="py-2 d-none d-md-inline-block">
        //         <Link to="/clubs" style={{textDecoration:'none', padding: '5px'}} >Connect</Link>
        //     </p>

        // </div>
        // </nav>
        <nav class="navbar navbar-expand-lg bg-body-tertiary">
        <div class="container-fluid">
            <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarText" aria-controls="navbarText" aria-expanded="false" aria-label="Toggle navigation">
            <span class="navbar-toggler-icon"></span>
            </button>
            <div class="collapse navbar-collapse" id="navbarText">
            <ul class="navbar-nav me-auto mb-2 mb-lg-0">
                <li class="nav-item">
                <a class="nav-link active" aria-current="page">
                <Link to="/home" >
                <img src="./logo.png" style={{height:'30px'}}></img>
                </Link>
                </a>
                </li>
                <li class="nav-item">
                <a class="nav-link">
                <Link to="/academics" style={{textDecoration:'none'}}>Academics</Link>
                </a>
                </li>
                <li class="nav-item">
                <a class="nav-link" href="#">
                <Link to="/clubs" style={{textDecoration:'none', padding: '5px'}} >Clubs and Chapters</Link>
                </a>
                </li>
            </ul>
            <span class="navbar-text">
                Navbar text with an inline element
            </span>
            </div>
        </div>
        </nav>
    )
}

export default Nav;
